import React, { Component } from 'react';
import{
	HomeWrapper,
	HomeLeft,
	HomeRight
}from './style.js'

class Home extends Component {
	render() {
		return (
			<HomeWrapper>
				<HomeLeft>
					<img className="banner-img" src="../../statics/bunny.png" alt=""/>
				</HomeLeft>
				<HomeRight>right</HomeRight>
			</HomeWrapper>
		)
	}
}

export default Home;
